import React, { Component } from "react";

class NikeExport extends Component {
  state = { token: "" };
  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <div className="form-group">
          <label>Token</label>
          <input
            class="form-control"
            placeholder="Bearer Token"
            type="text"
            name="token"
            ref={(input) => (this.input = input)}
          />
        </div>
      </form>
    );
  }
}

export default NikeExport;
